전투 시작 시 및 전투 중 20초마다 [래빗 스트라이커]를 2기 소환한다. [래빗 스트라이커]는 최대 15초 동안 전투에 참가하여 전용 장비로 적을 공격하거나, 라피Ⅱ의 능력치에 따라 자신의 능력치를 상승시킨다(능력치 상승폭은 스킬 레벨에 따라 다름). 
