		type = 3,
		max_level = 10,
		desc = "전투 중에 포격·명중이 $1 상승한다. \n전투 중에 아군 주력함대 멤버 및 선봉함대 선두 함선의 첫 번째 슬롯 장비가 적에게 명중한 경우, 50%의 확률로 적에게 [검은 페인트]를 1개 부여한다(장비 하나로 동일한 적에게는 5초에 1번만 부여 가능). [검은 페인트]는 10초 동안 지속되며, 적은 [검은 페인트]가 1개 부여될 때마다 항속이 5% 저하한다. [검은 페인트]는 최대 3개까지 부여할 수 있으며, 지속 시간 중에 다시 부여하면 지속 시간이 초기화된다. \n적 한 개체에 부여된 [검은 페인트]가 3개가 된 경우, 해당 적에게 [예술에 대한 헌신]을 부여한다. [예술에 대한 헌신]은 최대 10초 동안 지속되며, 부여된 적이 받는 피해량을 $2 상승시킨다. 사르데냐 엠파이어 함선에게 피해를 받은 경우, 추가로 피해가 $2 상승한다.",
