	[150950] = {
		desc_get = "",
		name = "흰색 페인트의 가호",
		type = 2,
		max_level = 10,
		desc = [[
전투 중에 자신이 받는 포격 피해량을 $1 경감한다. 
전투 중 소속 함대 함선이 입은 총 피해량이 내구 최대치의 20%에 달할 때마다 [흰색 페인트]를 얻는다. 전투 중 아군 함선이 [검은 페인트]를 가진 적을 격퇴한 경우, 격퇴 시점의 [검은 페인트] 숫자에 따라 [흰색 페인트]를 얻는다. 
[흰색 페인트]는 10초 동안 지속되며, 최대 3개까지 소지할 수 있으며, 지속 시간 중에 다시 획득한 경우에는 지속 시간이 초기화된다. 라파엘로가 전투 가능 상태일 때에 한해, 아군이 [흰색 페인트]를 획득할 때마다, 10초 동안 지속되며 라파엘로의 내구 최대치의 1%만큼 피해를 막아주는 실드를 생성한다. 해당 실드는 1장만 생성할 수 있으며, 실드 지속 중에 다시 [흰색 페인트]를 획득하면, 실드의 내구와 지속 시간이 초기화된다. 
아군 함선 한 척이 소지하고 있는 [흰색 페인트]가 3개가 된 경우, 해당 아군 함선에게 [예술의 가호]를 부여한다. [예술의 가호]는 10초 동안 지속되며, 부여된 아군이 입히는 피해량을 $2 상승시킨다. 해당 아군이 사르데냐 엠파이어 함선이면 주는 피해량이 추가로 $2 상승한다.]],
