	[150960] = {
		desc_get = "",
		name = "나는야 슈퍼 아티스트☆",
		type = 1,
		max_level = 10,
		desc = [[
자신이 전투 가능한 상태며, 자신이 소속된 함대 이외의 함대가 해당 함대의 1, 2, 3번째 전투에 돌입한 경우, 전투 시작 20초 후에 지원 탄막 $2(을)를 전개한다(위력은 스킬 레벨에 따라 다름). 
주포 공격 시에 $1의 확률로 특수 탄막 $2(을)를 전개한다(위력은 스킬 레벨에 따라 다름). 해당 특수 탄막 전개 시 전장에 있는 [검은 페인트]와 [흰색 페인트]에 따라 다음 효과를 발휘한다.
[흰색 페인트]를 가진 아군 함선이 있는 경우, 아군 함대 중 내구 수치가 가장 낮은 함선의 내구를 라파엘로의 내구 최대치의 2%만큼 회복시킨다. [예술의 가호]를 가진 함선이 있는 경우, 해당 회복 효과를 3회 발동한다(회복 대상은 효과 발동 시마다 판정됨).
[검은 페인트]를 가진 적이 있는 경우, 해당 특수 탄막의 크리티컬율이 50% 상승한다. [예술에 대한 헌신]을 가진 적이 있는 경우, 크리티컬 피해량이 20% 상승하며, 특수 탄막을 강화한다.]],
