		max_level = 10,
		desc = [[
전투 시작 시 특수 대공포 $1(을)를 장착한다(위력은 스킬 레벨에 따라 다름). 또한 자신의 첫 번째 장비 슬롯의 위력 보정이 15% 상승하며, 세 번째 장비 슬롯의 위력 보정은 30% 상승한다. 
