	[110190] = {
		desc_get = [[
장비 중인 주포·부포가 적에게 명중한 경우, $1의 확률로 발동하여 자신의 장전을 5% 상승시킨다(최대 3회까지). 해당 효과로 장전이 3회 상승한 경우, 다음 효과를 발동한다.
